    true,nt"url": null,nt"notes": "Social Security Administration released
    Earnings Public-Use File (EPUF) for 2006. File contains earnings information for
    individuals drawn from a systematic random 1-percent sample of all Social Security
    numbers (SSNs) issued before January 2007. EPUF consists of two linkable subfiles.
    One contains selected demographic and aggregate earnings information for all 4,348,254
    individuals in the file, and the second contains annual earnings records for the
    3,131,424 individuals who had positive earnings in at least 1 year from 1951 through
    2006. Please Note: This data set is very large and will not work properly in Microsoft
    Excel. Data software capable of handling large files should be used.",nt"license_title":
